// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract DNftParameters {
  uint public constant INSIDER_MINTS  = 4000;
  uint public constant START_PRICE    = 0.00001 ether; // 0.00001 ether
  uint public constant PRICE_INCREASE = 0.0000001 ether; // 0.001 ether
}

